import MovieItem from '../MovieItem'
import './index.css'

const MoviesSlider = props =>{
    const {itemList}=props
    return(
        <>
        {itemList.map(eachItem=>
            <MovieItem key={eachItem.id} eachItem={eachItem} />
            )}
            </>
        
    )
}

export default MoviesSlider
